    let count = 0;

    function calcularSubtotal () {
        let precioCompra = document.querySelector('#precio-compra').value;
        let cantidad = document.querySelector('#cantidad-productos').value;
        document.querySelector('#subtotal-compra').value = parseInt(precioCompra,10) * parseInt(cantidad,10);

    }

    
    function calcularSubtotalExistente () {
        let precioCompra = document.querySelector('#precio-compra-existente').value;
        let cantidad = document.querySelector('#cantidad-nueva').value;
        document.querySelector('#subtotal-compra').value = parseInt(precioCompra,10) * parseInt(cantidad,10);

    }

    function addProductoNuevoACarrito(tipo) {
        count++;
        let desc = document.querySelector('#descripcion-compra').value;
        let cantidad = document.querySelector('#cantidad-productos').value;
        let precioVenta = document.querySelector('#precio-venta-producto-compras').value;
        let fechaCaducidad = document.querySelector('#fecha-caducidad-productos-compras').value;
        // let subtotal = document.querySelector('#subtotal-compra').value;
        let precioCompra = document.querySelector('#precio-compra').value;
        let id = '0';

        if(isEmpty(desc)) {
            UICompra.mostrarAlert('Agrega la descripción del producto comprado', 'alert-danger');
            return;
        }
        if(isEmpty(precioCompra)) {
            UICompra.mostrarAlert('Agrega el precio unitario de la compra realizada', 'alert-danger');
            return;
        }

        let subtotal = parseInt(precioCompra,10) * parseInt(cantidad,10);

        UICompra.agregarProductoACarrito(desc, cantidad, precioVenta, fechaCaducidad, subtotal, tipo, count, id, precioCompra);

    }

    function addProductoExistente(tipo) {
        let selector = document.querySelector('#select-productos-existentes');
        count++;
        let desc = selector.options[selector.selectedIndex].innerHTML;
        let cantidad = document.querySelector('#cantidad-nueva').value;
        let precioVenta = '';
        let fechaCaducidad = '';
        let subtotal = document.querySelector('#subtotal-compra').value;
        let id = selector.options[selector.selectedIndex].getAttribute('id');

        let precioCompra = document.querySelector('#precio-compra-existente').value;

        if(isEmpty(cantidad)) {
            UICompra.mostrarAlert('Agrega la cantidad de productos comprados', 'alert-danger');
            return;
        }
        if(isEmpty(precioCompra)) {
            UICompra.mostrarAlert('Agrega el precio unitario de la compra realizada', 'alert-danger');
            return;
        }

        UICompra.agregarProductoACarrito(desc, cantidad, precioVenta, fechaCaducidad, subtotal, tipo, count, id, precioCompra);
    }

    countAparatos = 0;
    function addAparato() {
        countAparatos++;
        let desc = document.querySelector('#descripcion-aparato').value;
        let subtotal = document.querySelector('#subtotal-compra').value;

        if(isEmpty(desc)) {
            UICompra.mostrarAlert('Agrega la descripción del aparato', 'alert-danger');
            return;
        }
        if(isEmpty(subtotal)) {
            UICompra.mostrarAlert('Agrega subtotal de la compra del aparato', 'alert-danger');
            return;
        }

        UICompra.agregarAparatoACarrito(desc, subtotal, countAparatos);
    }




